-- cria��o da tabela de Ceps da Baixada
CREATE TABLE CepBaixada(
	Cd_Cep int NOT NULL,
	tipo varchar(19) NULL,
	Titulo varchar(20) NULL,
	Nome varchar(72) NULL,
	Bairro varchar(72) NULL,
	Cep varchar(9) NULL,
	Cidade varchar(72) NULL,
	UF char(2) NULL
) 

GO




