-- cria��o da tabela de usu�rios
CREATE TABLE usuarios(
	cd_usuario int primary key,
	cd_matricula char(6)  NOT NULL,
	nm_usuario varchar(50)  NOT NULL,
	dt_cadastro smalldatetime NULL,
	ic_login varchar(15)  NULL
)

